import { API_KEY } from "../globals";
import { BASE_URL } from "../globals";
import axios from 'axios'

export default function Markets() {
    async function getEndOfDay() {
        try {
            const response = await axios.get(`${BASE_URL}${API_KEY}/eod/latest`);
            console.log(response);
        } catch (error) {
            console.error(error);
        }
    }
    getEndOfDay()

    async function getStockTicker() {
        try {
            const response = await axios.get(`${BASE_URL}${API_KEY}/symbols`);
            console.log(response);
        } catch (error) {
            console.error(error);
        }
    }
    getStockTicker()

    async function getExchange() {
        try {
            const response = await axios.get(`${BASE_URL}${API_KEY}/exchange`);
            console.log(response);
        } catch (error) {
            console.error(error);
        }
    }
    getExchange()
}
